  true,\n\t\"url\": null,\n\t\"notes\": \"Dataset includes data from each experiment
  conducted in the pilot-scale testing.  Each sheet of the Excel file pertains to
  each test. A data dictionary is included in the first sheet.  In each sheet there
  are microbiological data (colony forming units) for each test and positive control
  coupon used in the study. Also shown is the calculation of decontamination efficacy
  (log10 reduction). nnThis dataset is associated with the following publication:nWood,
  J., W. Calfee, S. Ryan, L. Mickelsen, M. Clayton, and V. Rastogi. A Simple Decontamination
  Approach Using Hydrogen Peroxide Vapor for Bacillus anthracis Spore Inactivation.
